    dataIndex: '장치ID',
    width: 150,
  },
  {
    title: '장비명칭',
    dataIndex: '장비명칭',
  },
];
const data = [];

  data.push({
    key: i,
    순번: `Edward King ${i}`,
    장치ID: 32,
    장비명칭: `London, Park Lane no. ${i}`,
  });

const Tables = () => (
  <Table
    columns={columns}
    dataSource={data}
    pagination={{
      pageSize: 50,
    }}
    scroll={{
      y: 240,
    }}
  />
);
export default Tables;
